import React from "react";
import { withScriptjs, withGoogleMap, GoogleMap } from "react-google-maps";
import Bidmarker from "../atoms/Bidmarker";

const Bidmap = withScriptjs(withGoogleMap((props) =>{
  console.log("dentro de bidmap")
  let markers = props.products.map( (product, idx) => <Bidmarker
                    product={product}
                    location={{lat:product.bid.location.coordinates.lat, lng: product.bid.location.coordinates.lng}}
                  />);

  return (
      <GoogleMap
        defaultZoom={14}
        center={ { lat:  42.3601, lng: -71.0589 } }
        >
          {markers}
      </GoogleMap>
    );
  }
))

export default Bidmap;
